INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Fugiat aspernatur alias nihil provident.', 'Rerum doloribus nam vel dolorum eius quae. Delectus inventore consequuntur incidunt. Ut culpa impedit voluptates unde sunt illum fuga. Et ullam dicta eos rem fugit rerum ipsam.', 'Qui incidunt voluptatem atque. At ea quod iste voluptates ut dolor. Est illum cum omnis laboriosam consequatur.', '2017-07-01');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Qui rerum est enim dolorum voluptatem.', 'Minima consectetur fugiat recusandae assumenda distinctio quae. Quam in repellat eum et est. Quia esse culpa odio animi officia non.', 'Enim eaque corporis maxime id et. Voluptatem asperiores quae ducimus rerum. Quia et quos voluptates aut cupiditate. Aut numquam eaque atque in dolor.', '1970-04-11');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Saepe accusantium sint dignissimos eum iste commodi inventore aut.', 'Modi modi nemo est eligendi similique. Qui necessitatibus neque sapiente repellat dolorem ut porro hic. Deserunt sequi delectus corrupti ullam.', 'Beatae magnam sunt qui facilis voluptas alias. Debitis nobis soluta illo facere alias saepe. Tempora et dignissimos tempora sit voluptatem. Et magni temporibus sit sunt eos.', '2013-05-14');
